import React, { Component } from 'react';
import Chips from '../Chips/Chips';

const Style = {
    github: {
        color: 'rgb(241, 240, 179)',
        marginRight: 25
    },
    internet: {
        color: 'rgb(109, 195, 221)',
        marginLeft: 25
    }
};

export default class FirstWork extends Component {
    render() {
        return (
            <div className="caseOne">
                <div className="icons">
                    <Chips
                        name="React"
                        type="outlined"
                        coloType="green"
                    />
                    <Chips/>
                    <Chips/>
                </div>
                <div className="socials">
                    {/* eslint-disable-next-line */}
                    <a href="https://github.com/ChrisDemey/restaurant-css-framework" target="_blank"><i className="fab fa-github fa-5x" style={Style.github}></i></a>
                    {/* eslint-disable-next-line */}
                    <a href="https://chrisdemey.github.io/restaurant-css-framework/" target="_blank"><i className="fas fa-globe fa-5x" style={Style.internet}></i></a>
                </div>
            </div>
        );
    }
}
